@jayjaerudin @daggerdast @FerdinandHutah4 @KemenPU @PSSI @aniesbaswedan ya wis, cari dinas kebersihan bekasi, gmna ngurusnya. ga da hasil, krna ga da anggaran utk bersih2 saluran.
akhir thn 20, kesepakatan dri perumahan yg kena banjir, dan dinas bekasi, dibentuk tim swasta buat bersih2.
thn 21 kebanjiran 2x dan masuk 40cm.

@jayjaerudin @daggerdast @FerdinandHutah4 @KemenPU @PSSI @aniesbaswedan mulai berasa aneh, krna di sisi bekasi semua dah dilakuin. cek ke dinas bekasi, dapat info saluran utama ke bkt tersumbat.
cek lapangan, ternyata *TIDAK ADA* yg bersih2 saluran aer, saluran tersumbat di sisi jkta.
jdi bukan pihak kota bekasi yg ga tanggap, tpi jkta ga kerja.

@jayjaerudin @daggerdast @FerdinandHutah4 @KemenPU @PSSI @aniesbaswedan thn 2012 kaga banjir, tpi 2013 nya banjir lgi dan di rumah masuk 20cm. tpi setelah aliran aer ke bkt kelar dibuat, ga da banjir lgi, klo tergenang2 dikit tetep ada.
thn 2018, banjir lgi dan masuk rumah 20cm. sya nganggepnya siklus baru 5th.
dan 2019, 2020, masuk 20cm.

@jayjaerudin @daggerdast @FerdinandHutah4 @KemenPU @PSSI @aniesbaswedan thn 06 bangun rumah sendiri di bekasi. pas bangun rumah tinggiin tanah 1m, berasa cukup aman.
th 07 kebanjiran lgi, di rumah baru masuk sekitar 10cm.
pas banjir surut, ke rumah lama krna msh dititipin kunci ama pemilik buat awasin. dsna bekas aer banjirnya sekitar 170cm.

@jayjaerudin @daggerdast @FerdinandHutah4 @KemenPU @PSSI @aniesbaswedan sya ngekos d jkta dri 92 om, jaman pak wiyogo, ortu kontrak di jkta.
trus th 94, ortu kontrak rumah di bekasi krna kerjaan dkt dsna, tu jaman pak surjadi, tpi sya msh ngekos klo weekday, weekend pulang bekasi.
lulus kul 97, kerja dan ngekos di jkta.
